import React from "react";
import './MovieList.css';

function MovieList({items}) {
      if (Array.isArray(items)) {
            items.map((item) => console.log('Item:', item));
          } else {
            console.log('Items is not an array:', items);
          }
      
      return (
            <div>
                  <h1>hello</h1>
            </div>
      )
}
export default MovieList;
